0.9pt;\">\r\n <tbody><tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Liver shows homogeneous\r\n  parenchymal echopattern. No solid of cystic SOL is seen. Intra-hepatic\r\n  billiary channels are not dilated. <o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">CBD is not dilated.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Gall bladder is normal in\r\n  size. Lumen is clear.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Pancreas is normal in\r\n  size. Echo pattern is homogenous. No SOL is seen.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Spleen is normal in\r\n  size.&nbsp; No SOL is seen.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Both kidneys are normal in\r\n  size, shape and position with well-defined cortex and medulla.\r\n  Pelvic-calyceal systems are not dilated. No calculus is seen.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Urinary bladder is well\r\n  distended and smooth in outline. No intravesical lesion is seen.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Uterus is antiverted in\r\n  position and normal in size. Myometrial echopattern&nbsp; is homogenous. Cavity is empty<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Both the tubo-ovarian\r\n  regions appears normal and symmetrical. No cyst or mass lesion is seen. <o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">No collection is seen in\r\n  the cul-de-sac.<o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"590\" valign=\"top\" style=\"width:6.15in;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><i><span style=\"font-size:19.0pt;mso-bidi-font-size:\r\n  12.0pt\">Comment:-&nbsp;&nbsp; <o:p></o:p></span></i></b></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>  \r\n                      </div>\r\n\r\n                                        '),
