o-bidi-font-size:12.0pt\">No\r\n  collection is seen in the cul-de-sac.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"712\" valign=\"top\" style=\"width:534.35pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><span style=\"font-size:15.0pt;mso-bidi-font-size:12.0pt\">Post-void\r\n  sonogram shows no residual urine.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"712\" valign=\"top\" style=\"width:534.35pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><b><span style=\"font-size:19.0pt;mso-bidi-font-size:12.0pt\">Comment:- <o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>  \r\n                      </div>\r\n\r\n                                        '),
